  `status_cd` varchar(2) NOT NULL DEFAULT '0' COMMENT '数据状态，详细参考c_status表，S 保存，0, 在用 1失效',
  UNIQUE KEY `fee_id` (`fee_id`),
  KEY `idx_store_fee_fee_id` (`fee_id`),
  KEY `idx_store_fee_b_id` (`b_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

